    constructor(props) {
        super(props);
    }

    render() {
        return (
            <div className = "header">

                <ul className="header__links">
                    <li><a href="" className="header__link header__link_active">ABOUT</a></li>
                    <li><a href="#work" className="header__link">WORK</a></li>
                    <input className="button header_button" value="REQUEST FOR QUOTE"/>
                </ul>

               </div>
        );

    }

}

export default Header
